export class ActivityModel {
	constructor(data) {
		this.id = data.userId;
		this.sessions = data.sessions;
	}

	getSessions() {
		let datas = [];
		this.sessions.forEach((element) => {
			datas.push({
				name: element.day.format('dd'),
				Poids: element.kilogram,
				Calories: element.calories,
			});
		});
		return datas;
	}
}
